function App() {
  const [imageURL, setImageURL] = useState(null);
  const imageKey = "testing/images/b_image0007.png";
  useEffect(() => {
    const fetchPresignedUrl = async () => {
      try {
        const response = await fetch(`/api/get-presigned-url?key=${imageKey}`);
        const data = await response.json();
        setImageURL(data.url);
      } catch (error) {
        console.log('Erreur lors de la récupération de l’URL', error);
      }
    };

    fetchPresignedUrl();
  }, [imageKey]);



  return (
    <div className="App">
      <header className="bg-gradient-to-r from-blue-800 to-indigo-900">
      <div>
      {imageURL ? <img src={imageURL} alt="S3 Image" /> : <p>Chargement...</p>}
    </div>
        <p className=''>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
